"fui_email_link_trouble_getting_possible_fixes" : "Încercați aceste soluții folosite frecvent:
• verificați dacă e-mailul a fost marcat ca spam sau filtrat;
• verificați conexiunea la internet;
• verificați dacă ați scris corect adresa de e-mail;
• verificați dacă aveți spațiu în căsuța de e-mail sau dacă există alte probleme legate de setările căsuței de e-mail.
"

